	static int total = 0;
	
	public static void main(String[] args) {
		System.out.println(sudoku.length);
		System.out.println(sudoku[5].length);
		System.out.println(sudoku[0].length);
		eightyone a = new eightyone();
		System.out.println(a.Solve());	
		System.out.println("\n \n \n");
		a.printSudoku();
		System.out.println("");
		System.out.println(total);
	}
	
	
	public boolean Solve(){
		for(int i = 0; i < sudoku.length; i++){
			for (int j = 0; j < sudoku.length; j ++){
				if(sudoku[i][j] == 0){
					for(int n = 1; n < (sudoku.length + 1); n++){
						if(check(n, i, j)){
							sudoku[i][j] = n;
							//System.out.println(n);
							total += 1;
							if(Solve()){
								return true;
							}
						}
					}
					sudoku[i][j] = 0;
					return false;
				}
			}
		}
		return true;
	}
	
	
	public boolean check(int number, int row, int coll) {	
		for (int i = 0; i < sudoku.length; i++){
			if (sudoku[row][i] == number){
				return false;
			}
			if (sudoku[i][coll] == number){
				return false;
			}
			int r = (int) ((row/9)) * 9;
			int p = (int) ((coll/9)) * 9;
							
			for(int j = 0; j < Math.sqrt(sudoku.length); j++){
				for (int k = 0; k < Math.sqrt(sudoku.length); k++){
					if(number == sudoku[r + j][p + k]){
						return false;
					}
				}
			}			
		}		
		return true;
	}

	
		
	public void printSudoku(){
		for(int row=0;row<sudoku.length;row++){
			System.out.print("\n");
			for(int column=0;column<sudoku.length;column++){
				System.out.print(sudoku[row][column] + ",");
			}
		}
	}
